    false,nt"url": null,nt"notes": "This annual narrative report for Pea Island
    National Wildlife Refuge summarizes Refuge activities during the 1970 calendar year.
     The report begins with a summary of the weather and habitat conditions during
    the period.  Wildlife- including migratory birds, upland game birds, fur-bearing
    animals, predators, rodents, other mammals, predacious birds, fish, reptiles, and
    disease- is also covered.  The report includes a Refuge development and maintenance
    section which discusses physical developments, plantings, collections, vegetation
    control, and fires.  Resource management is outlined; no resources were used during
    this period.  A progress report on field investigations and applied research is
    also provided.  The public relations section of the report discusses recreational
    use of the Refuge, Refuge visitors, Refuge participation, hunting, violations, and
    safety.  Items of interest, N-R forms, and photographs are provided at the end of
    the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
